import React from "react";

function Jumbotron() {
  return (
    <div
      style={{ height: 300, clear: "both", paddingTop: 120, textAlign: "center" }}
      className="jumbotron"
    >
      <h1>(React) Google Books Search</h1>
      <h4> Search for and save books of interest </h4>
    </div>
  );
}

export default Jumbotron;
